import React from 'react';
import {Card} from 'react-bootstrap';
import axios from 'axios';
const Home = () =>{

    axios.get('http://localhost:8000/api/Equipos/?format=json')
        .then((response) => {
            const cartas = [];
            for (let index = 0; index < 17; index++) {     
                const respuesta = response.data[index];
                console.log(respuesta.Equipo);  
                var titulo = respuesta.Equipo;
                console.log(respuesta.ValorMedio);
                var valor = respuesta.ValorMedio;
                const cardInfo =                 
                    {
                        image: "https://cdn5.dibujos.net/dibujos/pintados/201746/escudo-del-club-atletico-de-madrid-deportes-escudos-de-futbol-11197949.jpg",
                        title:titulo,
                        text: valor
                    }
                cartas.push(cardInfo)                                        
            }
            return cartas;
        }); 
    const cardInfo = [
        
        {
            image: "https://cdn5.dibujos.net/dibujos/pintados/201746/escudo-del-club-atletico-de-madrid-deportes-escudos-de-futbol-11197949.jpg",
            title:"Test0",
            text: "0€"
        },
        {
            image: "https://1vs1-7f65.kxcdn.com/img/teams_new/548-big.png",
            title:"Test1",
            text: "1€"
        },
        {
            image: "https://logodownload.org/wp-content/uploads/2018/11/levante-ud-logo-escudo.png", 
            title:"Test2", 
            text: "2€"},
        {
            image: "http://assets.stickpng.com/images/584ad186b519ea740933a89e.png", 
            title:"Test3", 
            text: "3€"
        },
    ];

    const renderCard = (card, index) => {
        return(
            <React.Fragment>
                <Card style={{width: "18rem"}}>
                    <Card.Img width="100" height="250" variant="top" src="holder.js/100px180" src={card.image}/>
                </Card>
                <Card.Body>
                    <Card.Title>{card.title}</Card.Title>
                    <Card.Text>{card.text}</Card.Text>
                </Card.Body>
            </React.Fragment>            
        );
    }       

    return(
        <section class="row mt-5 ml-5">
            <div class="col-3">
                {cardInfo.map(renderCard)}
            </div>
            <div class="col-3">
                {cardInfo.map(renderCard)}
            </div>
            <div class="col-3">
                {cardInfo.map(renderCard)}
            </div>
            <div class="col-3">
                {cardInfo.map(renderCard)}
            </div>
        </section>
    );
}

export default Home;
